$ETH.X pipedream number 1: &quot;ETH is going down till 700, 400, lower&quot;
Reality: unless something really unexpected and very relevant happens, we&#39;ve already seen the bottom. Don&#39;t expect it to go bellow 1k any time soon.

Pipedream number 2: &quot;the merge will be awesome and/or ETH will hit 10k soon&quot;
Reality: ETH should be bullish for most of the rest of the year, and we could expect it to recover 3k levels before December 2022

Disclaimer: this is not financial advice. Just a reality check based on price movements and fundamentals that already been priced in. Do your own research, but please don&#39;t take seriously what many &quot;dreamers&quot; keep posting
